import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { Subject } from 'rxjs';
import { BrowserRouter as Router, Route, Link , Switch, Redirect} from "react-router-dom";
import { createBrowserHistory } from 'history';

const history  = createBrowserHistory();

class RestorePass extends Component{

	constructor(props){
		super(props)

		this.state={
			mail: ""
		}


	}
	componentDidMount(){
		let _this = this;




	}



	componentWillUnmount(){


	}

	inputHandler(e){
		let val = e.currentTarget.val;
		this.setState({mail: val})

	}

	onSubmitter(e){
		e.preventDefault();

		this.props.dispatch({type:"RESETPASS", payload: this.state.mail});
	}
	render(){
		return(
		<div className="ob">
			<h1>Введите свою почту</h1>	
			<form onSubmit={this.onSubmitter.bind(this)} >
			<input type="text" value={this.state.mail} onChange={this.inputHandler.bind(this)} name="mail" required/> 
				<button type="submit"> Отправить </button>
			</form>
			</div>
		)

	}

}


class InputNewPass extends Component{

	constructor(props){
		super(props)

		this.state={
			data: "TEXT"
		}


	}
	componentDidMount(){
		let _this = this;




	}


	componentWillUnmount(){


	}
	render(){
		return(
		<div className="ob">
			<h1>Введите новый пароль</h1>
			<input type="text" value={this.state.mail} name="mail"/> 


		</div>
		)

	}

}

class ProtectedMainPage extends Component{

	constructor(props){
		super(props)

		this.state={
			data: "TEXT"
		}


	}
	componentDidMount(){
		let _this = this;




	}


	componentWillUnmount(){


	}
	render(){
		return(
		<div className="ob">
			<h1>Введите новый пароль</h1>



		</div>
		)

	}

}


class NotFound extends Component{
	constructor(props){
		super(props)
	}

	render(){
		return(
				<div className="row ">
				<div className="col">
					<h1 className=" block_rxjs_subject">Страница не найдена</h1> 
				</div>
			</div>

		)
	}
}

class Restricted extends Component{
	constructor(props){
		super(props)
	}

	render(){
		return(
				<div className="row ">
				<div className="col">
					<h1 className=" block_rxjs_subject">
					Доступ запрещен
					</h1> 
					<p>
					Вы должны <Link to={"signin"}>войти</Link> или <Link to={"/registration"}>зарегистрироваться</Link>

					</p>
				</div>
			</div>

		)
	}
}


class Logger extends Component{
	constructor(props){
		super(props)

		this.state={
			userData:{
				userName: "",
				userPass: "",
			}
		}




	}

	componentDidMount(){
			let accessToken = null;

	}

	changeValue(e){
		let value = e.target.value;
		let field = e.target.name;

		let state = Object.assign({}, this.state);
		state[field] = value;
		this.setState(state)

	}
	onSubmitter(e){
		e.preventDefault();
		let userData= this.state.userData;
		this.props.dispatch({type: "REGISTRATION", payload: userData})
		console.log("userData dispatched", userData) 
	}

	render(){
		return(
				<div className="row">
					<div className="col">
					<h1>Вход</h1>
					<div className=" block_rxjs_subject">
						<Link to={"/"}>На главную</Link>
						<br/>
					<p>Войдите или зарегистрируйтесь</p>
					<form onSubmit={this.onSubmitter.bind(this)}>
					<p><input type="text" value={this.state.userName} onChange={this.changeValue.bind(this)} name="userName" /></p>
					<p><input type="text" value={this.state.userPass} onChange={this.changeValue.bind(this)} name="userPass" /></p>
					<p>
						<button>Войти</button> или <Link to={"/registration"}>Зарегистрироваться</Link> 
					</p>
					</form>
					<br/>
					<p>Забыли пароль? </p>
					<p>

						<Link to={"/resetpass"}>Восстановить пароль</Link>
					</p>
					</div>
					</div>
				</div>

		)
	}
}

class Registration extends Component{
	constructor(props){
		super(props)

		this.state={
			userData:{
				userName: "",
				userPass: "",
				userMail: "",
				userPassRepeat:"",
				acceptTerms: false,
			},
			passwordCheck: null,
			mailCheck: null,
			termsCheck: null
		}




	}

	componentDidMount(){
			let accessToken = null;

	}

	changeValue(e){
		let value = e.target.value;
		let field = e.target.name;


		let state = Object.assign({}, this.state);
		if(e.target.type=="checkbox" && typeof state[field]!=="undefined"){
			state[field] = !state[field].value;
		}else{
		state[field] = value;
		}
		this.setState(state)

	}

	onSubmitter(e){
		e.preventDefault();
		let userData= this.state.userData;
		this.props.dispatch({type: "REGISTRATION", payload: userData})
		console.log("userData dispatched", userData) 
	}

	render(){

		if(this.props.user!==null){
			return(
			<Redirect to="/usercabinet"/>
			)
		}
		return(
				<div className="row">
					<div className="col">

					<h1>Регистрация</h1>
					<div className=" block_rxjs_subject">
					<form onSubmit={this.onSubmitter.bind(this)}>
					<Link to={"/"}>На главную</Link>
						<br/>
					<p>Зарегистрируйтесь</p>
					<p><input type="text" value={this.state.userName} placeholder="Ваше имя*" onChange={this.changeValue.bind(this)} name="userName" required/></p>
					<p><input type="text" value={this.state.userMail} placeholder="Ваша почта*" onChange={this.changeValue.bind(this)} name="userMail" required/></p>
					<p><input type="text" value={this.state.userPass} placeholder="Пароль*" onChange={this.changeValue.bind(this)} name="userPass" required/></p>
					<p><input type="text" value={this.state.userPassRepeat} placeholder="Повторите пароль*" onChange={this.changeValue.bind(this)} name="userPass" required/></p>
					<p><input type="checkbox" value={this.state.acceptTerms}  onChange={this.changeValue.bind(this)} name="acceptTerms" required/>* Согласен с политикой конфиденциальности</p>
					<p>
						<button type="submit" >Зарегистрироваться</button> или <Link to={"/signin"}>Войти</Link> 
					</p>
					<br/>

